import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Login from "../src/pages/User/Login";

function App() {
  return (
    <div className="todo-app">
      <Router>
        <Routes>
          <Route path="/login" element={<Login />}></Route>
          {/* <Route path="/">
          <Home />
        </Route> */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
